userIconPath.value:
if (!$data.loggedUser) {
    return "";
}

var isCustomIconPath = $data.loggedUser.icon && $data.loggedUser.icon!="icons/default/icon_user.png";

return isCustomIconPath ? $data.loggedUser.icon : "../theme/icons/default/icon_user.png";

appsListGroupByThree.value:
if (!$data.appsList) {
    return [];
}

var i = 0;
var result = [];
while (i < $data.appsList.length) {
    if (i%3 === 0) {
        result.push([]);
    }
    result[Math.floor(i/3)].push($data.appsList[i]);
    i++;
}

return result;

applicationContainerClasses.value:
return function (currentApp){
    var cssClasses = "app-item ";

    if(currentApp.token === $data.appToken){
        cssClasses += "app-item--current";
    }

    return cssClasses;
};
